import React from "react";
import "../css/Resume.css";
import { Document, Page } from "react-pdf/dist/esm/entry.webpack";
import resume from "../img/resume.pdf";

function Resume() {
    if (window.innerWidth > 650) {
  return (
    <div>
      <div className="non-mobile" style={{ position: "fixed" }}>
        <Document file={resume} className="resume-file">
          <Page pageNumber={1} />
        </Document>
      </div>
      <div className="mobile-only">Mobile Resume Awaiting Implementation</div>
    </div>
  );
    }
    return (
        <div></div>
    )
}

export default Resume;
